            <div className="px-4">
                <img src={feat} alt="feat" />
            </div>
            <div>
            <div className="text-center font-popins mt-6 px-2">
                <h3 className="text-green-cf">WHY CHOOSE US</h3>
                <h2 className="text-2xl text-medium leading-10">
                Find Favorites and Discover New Ones
                </h2>
                <h3 className="text-gray-cf leading-[2rem]">
                At vero eos et accusamus et iusto odio dignissimos ducimus blanditiis praesen voluptatum deleniti.
                </h3>
            </div>
            <div className="flex justify-center items-center">
